import React, { Component } from 'react';
import './App.css';
const axios = require('axios');

class App extends Component {
  dataFromBack() {
    axios.get('http://localhost:8000/circus')
  }
  render(){
    return (
    <div className="App">
      <p>{dataFromBack}</p>
    </div>
    );
  }
}

export default App;
